description:
Here it is. A compilation of the &quot;greatest hits&quot; of Boston Spaceships, released by Fire Records. It features Pollard's songwriting at its finest, as well as some special guests. It's a great album.

Song listing:

1	&quot;You Satisfy Me&quot;
2	&quot;John the Dwarf Wants to Become an Angel&quot;
3	&quot;Earmarked For Collision&quot;
4	&quot;Question Girl Alright &quot;
5	&quot;Make A Record For Lo-Life&quot;
6	&quot;Headache Revolution &quot;
7	&quot;Tabby And Lucy&quot;
8	&quot;Canned Food Demon &quot;
9	&quot;How Wrong You Are &quot;
10	&quot;Come On Baby Grace&quot;
11	&quot;German Field Of Shadows&quot;
12	&quot;Let is Rest for a Little While &quot;
13	&quot;Big O Gets an Earful &quot;
14	&quot;In the Bathroom (Up Half The Night) &quot;
15	&quot;Tourist UFO&quot;

This album is in the FLAC format. High bit rate, large file size, great quality.

Enjoy!
